import React from "react";
import { Routes, Route, Link, useNavigate } from "react-router-dom";
import styled from "styled-components";
import Navbar from "../../components/Navbar";
import Step1Page from "../game/Step1Page";
import Step2Page from "../game/Step2Page";
// import Step3Page from "../game/Step3Page";
// import NotFoundPage from "../NotFoundPage";
import MyPage from "../MyPage";

const WarmingUpPage = () => {
  const navigate = useNavigate();
  return (
    <Wrap>
      <Routes>
        <Route path="game/*" element={<Navbar />} />
      </Routes>

        <Routes>
          <Route path="game/*" element={<WarmingUpPage />} />
          <Route path="game/step_1" element={<Step1Page />} />
          <Route path="game/step_2" element={<Step2Page />} />
          <Route path="game/step_3" element={<Step3Page />} />
          <Route path="game/my/:username" element={<MyPage />} />
          <Route path="game/result" element={<FailPage />} />
        <Route path="/*" element={<NotFoundPage />} />
        </Routes>
    

      <Link to="user/:username">
        <Btn>나의 키링 보관함</Btn>
      </Link>
      <Link to="step_1">
        <Btn>빼빼로 만들고 키링 뽑기</Btn>
      </Link>


    </Wrap>
  );
};

const NavWrap = styled.div`
  width: 100%;
`;
const Wrap = styled.div`
  width: 60%;
  height: 100%;
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: center;
`;

const Btn = styled.button`
  width: 350px;
  height: 350px;
  border-radius: 50%;
  border: 2px solid orange;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 2rem;
  &:first-child {
    margin-right: 5%;
  }
`;

export default WarmingUpPage;
